// A replacement for TrickInput.js that completely bypasses standard styling
// by using a dynamically generated table structure

import React, { useState, useEffect } from 'react';

const TrickInput = ({ onTrickChange, initialResult = null, contract = '', onChangeContract }) => {
  const [selectedTrick, setSelectedTrick] = useState(null);
  const [requiredTricks, setRequiredTricks] = useState(7);
  
  // Calculate required tricks when contract changes
  useEffect(() => {
    if (contract) {
      const contractMatch = contract.match(/(\d)([♣♦♥♠]|NT)\s+([NESW])(X{0,2})/);
      if (contractMatch) {
        const level = parseInt(contractMatch[1]);
        setRequiredTricks(level + 6);
      }
    }
  }, [contract]);
  
  // Set selected trick from initialResult if provided
  useEffect(() => {
    if (initialResult !== null && requiredTricks) {
      // Calculate actual tricks from result
      const actualTricks = requiredTricks + initialResult;
      setSelectedTrick(actualTricks);
    }
  }, [initialResult, requiredTricks]);
  
  // Handle trick button click
  const handleTrickClick = (numTricks) => {
    setSelectedTrick(numTricks);
    
    // Calculate result based on tricks and required tricks
    const result = numTricks - requiredTricks;
    onTrickChange(result, numTricks);
  };
  
  // Render a trick cell with styling based on selection state
  const renderTrickCell = (trickNum) => {
    const isSelected = selectedTrick === trickNum;
    const isExact = trickNum === requiredTricks;
    const isMade = trickNum > requiredTricks;
    const isDown = trickNum < requiredTricks;
    
    let backgroundColor, borderColor, color;
    
    if (isSelected) {
      if (isExact) {
        backgroundColor = '#ff9800';
        borderColor = '#ff9800';
      } else if (isMade) {
        backgroundColor = '#4caf50';
        borderColor = '#4caf50';
      } else {
        backgroundColor = '#f44336';
        borderColor = '#f44336';
      }
      color = 'white';
    } else {
      if (isExact) {
        backgroundColor = '#fff3e0';
        borderColor = '#ffe0b2';
      } else if (isMade) {
        backgroundColor = '#e8f5e9';
        borderColor = '#c8e6c9';
      } else {
        backgroundColor = '#ffebee';
        borderColor = '#ffcdd2';
      }
      color = 'black';
    }
    
    const style = {
      height: '30px',
      width: '30px',
      padding: '0',
      textAlign: 'center',
      cursor: 'pointer',
      verticalAlign: 'middle',
      border: `1px solid ${borderColor}`,
      borderRadius: '4px',
      backgroundColor: backgroundColor,
      color: color,
      fontWeight: 'bold'
    };
    
    return (
      <td 
        key={`trick-${trickNum}`}
        style={style}
        onClick={() => handleTrickClick(trickNum)}
      >
        {trickNum}
      </td>
    );
  };
  
  return (
    <div style={{ padding: '0', margin: '0', maxWidth: '100%', maxHeight: '250px' }}>
      <table style={{ width: '100%', borderCollapse: 'separate', borderSpacing: '3px' }}>
        <tbody>
          {/* Required tricks row */}
          <tr>
            <td colSpan="4" style={{ 
              backgroundColor: '#f0f3f8', 
              padding: '4px', 
              borderRadius: '4px', 
              textAlign: 'center',
              fontSize: '12px',
              fontWeight: 'bold',
              color: '#2c3e50',
              border: '1px solid #dfe6e9'
            }}>
              Required tricks: {requiredTricks}
            </td>
          </tr>
          
          {/* Tricks rows - 0-3 */}
          <tr>
            {[0, 1, 2, 3].map(num => renderTrickCell(num))}
          </tr>
          
          {/* Tricks rows - 4-7 */}
          <tr>
            {[4, 5, 6, 7].map(num => renderTrickCell(num))}
          </tr>
          
          {/* Tricks rows - 8-11 */}
          <tr>
            {[8, 9, 10, 11].map(num => renderTrickCell(num))}
          </tr>
          
          {/* Tricks rows - 12-13 (just two cells) */}
          <tr>
            <td colSpan="1" style={{ width: '25%' }}></td>
            {renderTrickCell(12)}
            {renderTrickCell(13)}
            <td colSpan="1" style={{ width: '25%' }}></td>
          </tr>
          
          {/* Change Contract button */}
          <tr>
            <td colSpan="4" style={{ padding: '3px 0 0 0' }}>
              <button 
                style={{
                  width: '100%',
                  height: '30px',
                  border: '1px solid #ddd',
                  borderRadius: '4px',
                  backgroundColor: '#f5f5f5',
                  color: '#2c3e50',
                  fontSize: '13px',
                  fontWeight: 'bold',
                  cursor: 'pointer'
                }}
                onClick={onChangeContract}
              >
                Change Contract
              </button>
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default TrickInput;
